void ChatWindow::on_textEdit_cursorPositionChanged()
{
    QClipboard* buf = QApplication::clipboard();

    QTextCursor cursor = ui->textEdit->textCursor();
    cursor.select(QTextCursor::LineUnderCursor);
    ui->textEdit->copy();

