shader = Shader(
[[
layout (location = 3) in vec3 color;
out vec3 vColor;
out vec3 vNormal;
out vec3 vPosition;
void main() {
  vec4 pos = modelMatrix * vec4(position, 1.0);
  vColor = color;
  vNormal = normalMatrix * normal;
  vPosition = pos.xyz;
  gl_Position = projectionMatrix * viewMatrix * pos;
}
]],
[[
in vec3 vColor;
in vec3 vNormal;
in vec3 vPosition;
float phong(in vec3 lightDir) {
  float ambient = 0.03;
  vec3 normal = normalize(vNormal);
  float diffuse = max(dot(lightDir, normal), 0.0);
  float specular = pow(max(dot(normal, normalize(lightDir + normalize(viewPosition - vPosition))), 0.0), 32.0) * 0.5;
  return (ambient + diffuse + specular);
}
void main() {
  gl_FragColor = sRGB(vec4(vColor * (phong(normalize(vec3(-0.5, 0.5, 0.5))) + phong(normalize(vec3(0.5, -0.5, 0.5)))), 1.0));
}
]]
)
voxels = Voxels(shader)

function generate()
  local r = 32
  for z=-r,r do
    for y=-r,r do
      for x=-r,r do
        local dz = z
        local dy = y
        local dx = x
        local d = math.sqrt(dz * dz + dy * dy + dx * dx)
        if d < r then
          local r, g, b = math.hsv(math.random(), 0.5 + math.random() * 0.5, (d / r) * 0.5)
          voxels:update(x, y, z, 1, r, g, b)
        end
      end
    end
  end
end

function update(vx, vy, vz, r)
  for z=-r,r do
    for y=-r,r do
      for x=-r,r do
        local d = math.sqrt(z * z + y * y + x * x)
        if d < r then
          voxels:update(vx + x, vy + y, vz + z, 0)
        end
      end
    end
  end
end

generate()
