// Bibliotecas
import 'dart:io';

// Funcao principal
main() {
  // Funcao
  print(entDados());
}

// Funcao: Entrada de dados
int entDados() {
  // Variaveis
  int d, h, m;

  stdout.write("# Dias: ");
  d = int.parse(stdin.readLineSync()!);

  stdout.write("# Horas: ");
  h = int.parse(stdin.readLineSync()!);

  stdout.write("# Minutos: ");
  m = int.parse(stdin.readLineSync()!);

  return calculoSeg(d, h, m);
}

// Calculo
int calculoSeg(int d, int h, int m) {
  return 60 * (d * 24 * 60 + h * 60 + m);
}

// Bibliotecas
import 'dart:io';

// Funcao principal
main() {
  // Variaveis
  var opc;
  double a, b;

  // Entrada de dados
  stdout.write("# Primeiro valor: ");
  a = double.parse(stdin.readLineSync()!);

  stdout.write("# Segundo valor: ");
  b = double.parse(stdin.readLineSync()!);

  // Menu
  stdout.writeln("\n# Operacoes matematicas");
  stdout.writeln("# [+] Somar");
  stdout.writeln("# [-] Subtrair");
  stdout.writeln("# [*] Multiplicar");
  stdout.writeln("# [/] Dividir");
  stdout.write("# Opc: ");
  opc = stdin.readLineSync()!;

  // Chamada de metodo
  operacao(a, b, opc);
}

// Funcao
void operacao(double a, double b, var opc) {
  if (opc == "+") {
    print("\n# Soma: " + (a + b).toStringAsFixed(2));
  } else if (opc == "-") {
    print("\n Subtrair: " + (a - b).toStringAsFixed(2));
  } else if (opc == "*") {
    print("\n# Multiplicar: " + (a * b).toStringAsFixed(2));
  } else if (opc == "/") {
    try {
      print("\n# Dividir: " + (a / b).toStringAsFixed(2));
    } catch (e) {
      //print(e);
    }
  } else {
    print("# Opcao invalida !");
  }
}

// Bibliotecas
import 'dart:io';

// Funcao principal
main() {
  // Variaveis
  int a, b, c, aux;

  // Entrada de dados
  stdout.write("# Digite valor: ");
  a = int.parse(stdin.readLineSync()!);

  stdout.write("# Digite valor: ");
  b = int.parse(stdin.readLineSync()!);

  stdout.write("# Digite valor: ");
  c = int.parse(stdin.readLineSync()!);

  // Estrutura condicional
  if (a > b) {
    aux = a;
    a = b;
    b = aux;
  }

  if (a > c) {
    aux = a;
    a = c;
    c = aux;
  }

  if (b > c) {
    aux = b;
    b = c;
    c = aux;
  }

  // Ordem
  print("# Maior: " + c.toString());
  print("# Menor: " + a.toString());

  // Ordenamento
  print("# Ordem crescente: " + ordemCrescente(a, b, c));
  print("# Ordem Decrescente: " + ordemDecrescente(a, b, c));
}

// Funcao
String ordemCrescente(int a, int b, int c) {
  return a.toString() + " | " + b.toString() + " | " + c.toString();
}

// Funcao
String ordemDecrescente(int a, int b, int c) {
  return c.toString() + " | " + b.toString() + " | " + a.toString();
}

// Bibliotecas
import 'dart:io';

// Funcao principal
main() {
  // Entrada de dados
  stdout.write("# Taxa de juros: ");
  double tax_jur = double.parse(stdin.readLineSync()!);

  print(divida(tax_jur));
}

String divida(double taxa) {
  // Variaveis
  int lim = 3;
  int mes = 1;
  double acum = 0;
  double val_men;

  while (mes <= lim) {
    // Valor do pagamento
    stdout.write("\n# Deposito mensal: ");
    val_men = double.parse(stdin.readLineSync()!);

    // Calculo
    acum += val_men;
    acum += acum * taxa / 100;
    print("# Mes ($mes): R\$ " + acum.toStringAsFixed(2));

    // Incremento
    mes++;
  }
  return "\n# Total: R\$ " + acum.toStringAsFixed(2);
}

// Bibliotecas
import 'dart:io';

// Funcao principal
main() {
  // Variaveis
  int mes = 1;

  // Entrada de dados
  stdout.write("# Valor da divida: ");
  double div = double.parse(stdin.readLineSync()!);

  stdout.write("# Taxa de juros mensal: ");
  double jur_men = double.parse(stdin.readLineSync()!);

  while (div > 0) {
    div += div * jur_men / 100;
    print("\n* Divida (mes $mes): R\$ " + div.toStringAsFixed(2));

    // Valor mensal a pagar
    stdout.write("+ Valor mensal que sera pago: ");
    double val_men = double.parse(stdin.readLineSync()!);

    // Abatimento da divida
    div -= val_men;

    // Estrutural condicional: Pagamento acima do valor da divida
    if (div < 0) {
      print("\n- Pagamento concluido com sucesso no mes $mes");
      print("# Troco: R\$ " + (-1 * div).toStringAsFixed(2));
    }
    // Pagamento no exato valor da divida
    else if (div == 0) {
      print("\n- Pagamento concluido com sucesso no $mes");
    }

    // Relatorio do abatimento na divida
    else {
      print("+ Valor pago: R\$" + val_men.toStringAsFixed(2));
      print("+ Divida atual: R\$ " + div.toStringAsFixed(2));
    }

    // Contagem de meses
    mes++;
  }
}

