function export_bp() {
  let exportLines = [];
  console.log("Exporting...");
  backpackHeadings.forEach((heading) => {
    //     console.log(`# ${heading.innerHTML}`);
    //     console.log("---");
    if (exportLines.length) {
      exportLines.push("\n");
    }
    exportLines.push(`# ${heading.innerHTML}`);
    exportLines.push("---");

    let par = heading.parentElement.parentElement.parentElement;
    let entriesRow = par.querySelector("div + .objectRow");
    let entries = entriesRow.querySelectorAll("span.fullHeight");
    entries.forEach((entry) => {
      // h3 main headings of CYOA choices
      let entryHeading = entry.querySelector("h3");
      let entryHeadingText = entryHeading.innerHTML;

      // numeric value for multichoice
      let entryNum = entry.querySelector("h3 + .row > .spacer + button + .spacer + div");
      if (entryNum) {
        entryHeadingText += ` (x${entryNum.innerHTML})`;
      }
      // h4 subheadings
      let subHeadings = entry.querySelectorAll("h4");
      let subHeadingText = [];
      subHeadings.forEach((sub) => {
        subHeadingText.push(sub.innerHTML);
      });
      if (subHeadingText.length) {
        subHeadingText = ` (*${subHeadingText.join(', ')}*)`;
      } else {
        subHeadingText = "";
      }
      entryHeadingText += subHeadingText;
      //       console.log(`* ${entryHeadingText}`);
      exportLines.push(`* ${entryHeadingText}`);
    });
  });
  //   return exportLines;
  document.querySelector('.export-text').value = exportLines.join("\n");
  document.querySelector('.export-text').classList.add('d-inline-block');
}

function setupExport() {

  let rowHeadings = '.v-dialog__content--active[role=document] > .v-dialog--active .col-12 img[src=""] + h2';

  let symCSS = `<link rel="stylesheet" href="https://fonts.googleapis.com/css2?family=Material+Symbols+Outlined:opsz,wght,FILL,GRAD@20..48,100..700,0..1,-50..200" />`;
  symCSS = htmlToElement(symCSS);

  let exportRow = `<div class="row"></div>`;
  exportRow = htmlToElement(exportRow);

  let exportTextarea = `<textarea class="export-text" rows="15""></textarea>`;
  exportTextarea = htmlToElement(exportTextarea);



  let symbol = `<span id="exportBtn" class="v-icon material-symbols-outlined theme--dark export-btn btn">
export_notes
</span>`;
  symbol = htmlToElement(symbol);

  symbol.addEventListener('click', export_bp);

  exportRow.prepend(exportTextarea);
  exportRow.prepend(symbol);

  backpackHeadings = document.querySelectorAll(rowHeadings);

  let bpTop = backpackHeadings[0].parentElement.parentElement.parentElement.parentElement.parentElement.parentElement;

  bpTop.prepend(exportRow);
  //   bpTop.prepend(customCSS);
  bpTop.prepend(symCSS);
}

