alias aw.loadpages {
  unset %away.curpage
  did -b awaypager 21
  var %d,%t,%a,%l = 1,%z
  xdid -r awaypager 1
  xdid -a awaypager 1 0 $chr(9) +eb 0 0 0 0 0 $chr(9) Pages
  if ($isfile(scripts\txt\awpages.txt)) {
