        xdid -a awaypager 1 -1 -1 $chr(9) $iif($1,+,+b) 0 0 0 0 0 $chr(9) $gettok($3,1,33) $chr(9) $+(Page: #,%l,$crlf,From: ,$3,$crlf,Rcvd: ,$asctime($2,%timeformat),$crlf,Status: ,$iif($1,Read,Unread))
      }
