  }
  did -ra awaypager 8 Select a page!
  did -ra awaypager 10,13,15 n/a
}

#include <bits/stdc++.h>
 
using namespace std;
 
const int maxn = 1e5, maxk = 1e6 + 1;
int root[maxn], L[16 * maxn], R[16 * maxn], sum[16 * maxn];
int rt = 1, sz = 1;
int lpos[maxk];
 
int copy(int v, int &u)
{
    L[sz] = L[v];
    R[sz] = R[v];
    sum[sz] = sum[v];
    return u = sz++;
}
 
void make_root()
{
    copy(root[rt - 1], root[rt]);
    rt++;
}
 
void add(int pos, int x, int v = root[rt - 1], int l = 0, int r = maxn)
{
	sum[v] += x;
    if(r - l == 1)
        return;
    int m = (l + r) / 2;
    if(pos < m)
        add(pos, x, copy(L[v], L[v]), l, m);
    else
        add(pos, x, copy(R[v], R[v]), m, r);
}
 
int get(int a, int b, int v, int l = 0, int r = maxn)
{
    if(a <= l && r <= b)
        return sum[v];
    if(r <= a || b <= l)
        return 0;
    int m = (l + r) / 2;
    return get(a, b, L[v], l, m) + get(a, b, R[v], m, r);
}
 
int main()
 {
    ios::sync_with_stdio(0);
    cin.tie(0);
    int n;
    cin >> n;
    for(int i = 1; i <= n; i++)
    {
        int t;
        cin >> t;
        make_root();
        add(lpos[t], -1);
        lpos[t] = i;
        add(lpos[t], 1);
    }
 
    int q, l, r;
    cin >> q;
    while(q--)
    {
        cin >> l >> r;
        cout << get(l, r + 1, root[r]) << "\n";
    }
    return 0;
 }

#include <bits/stdc++.h>
#define int int16_t

const int kN = 71;
const int kNN = kN * kN + 1;

std::string s[kN];
std::vector<int> G[kNN];
int c[kNN][kNN];
int p[kNN];
bool used[kNN];

int32_t main() {
    int n, m;
    std::cin >> n >> m;
    int w, b, g;
    std::cin >> w >> b >> g;
    for (int i = 0; i < n; ++i)
        std::cin >> s[i];
    const int N = n * m + 2;
    int from = 0;
    int to = m * n + 1;
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < m; ++j) {
            int cur_num = i * m + j + 1;
            if (s[i][j] == 'W') {
                G[from].push_back(cur_num);
                c[from][cur_num] = b;
                G[cur_num].push_back(from);
            } else {
                G[to].push_back(cur_num);
                c[cur_num][to] = w;
                G[cur_num].push_back(to);
            }
            if (i + 1 < n) {
                int d_num = (i + 1) * m + j + 1;
                G[cur_num].push_back(d_num);
                c[cur_num][d_num] = g;
                G[d_num].push_back(cur_num);
                c[d_num][cur_num] = g;
            }
            if (j + 1 < m) {
                int r_num = i * m + j + 2;
                G[cur_num].push_back(r_num);
                c[cur_num][r_num] = g;
                G[r_num].push_back(cur_num);
                c[r_num][cur_num] = g;
            }
        }
    }
    int32_t ans = 0;
    std::fill(p, p + N, -1);
    while (true) {
        std::fill(used, used + N, false);
        std::fill(p, p + N, -1);
        std::queue<int> q;
        q.push(from);
        used[from] = true;
        while(!q.empty()){
            int v = q.front();
            q.pop();
            for (int nxt : G[v])
                if (!used[nxt] && c[v][nxt] > 0) {
                    p[nxt] = v;
                    used[nxt] = true;
                    q.push(nxt);
                }
        }
        if (!used[to])
            break;
        int cur = std::numeric_limits<int>::max();
        for (int i = to; p[i] != -1; i = p[i]) {
            int f = p[i];
            int st = i;
            cur = std::min(cur, c[f][st]);
        }
        ans += cur;
        for (int i = to; p[i] != -1; i = p[i]) {
            int f = p[i];
            int st = i;
            c[f][st] -= cur;
            c[st][f] += cur;
        }
    }
    std::cout << ans;
}

#include <vector>
#include <cmath>
#include <iostream>

using namespace std;
using ll = long long;


int NIL = -1;
int POSSIBLE = 1;
int IMPOSSIBLE = 0;

vector<int> v;
ll cases, n, r, m;

ll modBinExp(ll x, ll y, ll n)
{
    if (y == 0) return 1;

    ll res = modBinExp(x, y/2, n);
    res = (res * res) % n;

    if (y % 2 == 1) res = (res * x) % n;

    return res;
}

bool dp(int pos, ll res, vector<vector<int>>& memo) {
    if (pos == memo.size()) return res == r;
    if (memo[pos][res] != NIL) return memo[pos][res] == POSSIBLE;

    ll a = v[pos] % m;

    bool ans = false;
    ans |= dp(pos + 1, (res + a) % m, memo);
    ans |= dp(pos + 1, (res - a + m) % m, memo);
    ans |= dp(pos + 1, (res * a) % m, memo);
    ans |= dp(pos + 1, modBinExp(res, v[pos], m), memo);

    memo[pos][res] = ans ? POSSIBLE : IMPOSSIBLE;
    return ans;
}

int main() {
    ll a;
    cin >> cases;
    while (cases--)
    {
        v.clear();
        cin >> n >> r >> m;
        vector<vector<int>> memo(n, vector<int> (m, -1));
        while (n--)
        {
            cin >> a;
            v.push_back(a);
        }

        cout << (dp(1, v[0] % m, memo) ? "Si" : "No");
    }

    return 0;
}

